import React from 'react';
import '../../asset/CSS/Main.css';
const axios = require('axios');
const SanPham =({name, gia, img}) =>{
  return(
    <div className="KhoiSanPham">
      <div style={{width: '280px', height: '380px', margin: 25}}>
        <div className="KhoiAnh" style={{width: '100%', height: '280px'}}>
          <a href><img src={img} width="100%" height="100%" alt="" /></a>
        </div>
        <div className="KhoiText">
          <h3><a href>{name}</a></h3>
          <div className="Gia">
            {gia} VND
          </div>
          <div className="MuaHang">
            <a href><i className="fa fa-shopping-cart" />Mua</a>
          </div>
        </div>
      </div>
  </div>
  );
}
const Block = () => {
  const [DuLieu , setDuLieu] = React.useState([]);
  React.useEffect(() =>{
    axios.get('http://localhost:5000/')
    .then(function (response) {
      console.log(response);
      setDuLieu(response);
    })
    .catch(function (error) {
      // handle error
      console.log(error);
    })
    .then(function () {
      // always executed
    });
  });
    return (
      <div style={{display: 'flex', flexWrap: 'wrap'}}>
        {
          DuLieu.map(val =>{
            <SanPham id name = {val.name} gia = {val.Gia} img = {val.img}/>
          })
        } 
      </div>
    );
  }
  
  export default Block;
